import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navs from './components/Nav/Navs';
import Footer from './components/Footer/Footer';
// import MovieList from './pages/MovieList/MovieList';
// import MovieDetail from './pages/MovieDetail/MovieDetail';
// import Booking from './pages/Booking/Booking';
// import Login from './pages/Login/Login';
import Main from './pages/Main/Main';


import Header from "./components/Header/Header";
// import KaKaoAPI from './pages/Login/KakaoAPI';
// import Seats from './pages/Booking/Seats/Seats';
// import SelectMovie from './pages/Booking/SelectMovie';
// import Theater from './pages/Theater/Theater';
// import Chart from './pages/Chart/Chart';


const router = createBrowserRouter([
    {
        element: <Root />,
        errorElement: <ErrorPage />,
        children: [
            {
                path: "/",
                element: <App />,
            },
            {
                path: "services",
                element: <Services />,
            },
            {
                path: "about",
                element: <About />,
            },
            {
                path: "web-design",
                element: <WebDesign />,
            },
            {
                path: "web-dev",
                element: <WebDev />,
            },
            {
                path: "frontend",
                element: <Frontend />,
            },
            {
                path: "node",
                element: <NodeJs />,
            },
            {
                path: "php",
                element: <Php />,
            },
            {
                path: "seo",
                element: <SEO />,
            },
        ],
    },
]);


const Router = () => {
    return (
        <BrowserRouter>
            <Header />
            <Routes>
                <Route path="/" element={<Main />} />
                {/*<Route path="/booking" element={<Booking />} />*/}
                {/*<Route path="/login" element={<Login />} />*/}
                {/*<Route path="/users/login" element={<KaKaoAPI />} />*/}
                {/*<Route path="/seats" elememt={<Seats />} />*/}
                {/*<Route path="/chart" element={<Chart />} />*/}

                {/* <Route path="/login" element={<Login />} /> */}
                {/*<Route path="/movieList" element={<MovieList />} />*/}
                {/*<Route path="/movieDetail/:id" element={<MovieDetail />} />*/}
                {/*<Route path="/selectmovie" element={<SelectMovie />} />*/}
                {/*<Route path="/chart/detail/:id" element={<MovieDetail />} />*/}
                {/*<Route path="/payment" element={<Payment />} />*/}
                {/*<Route path="/payment/approval" element={<PaymentApproval />} />*/}
                {/*<Route path="/payment/cancel" element={<PaymentCancel />} />*/}
                {/*<Route path="/payment/fail" element={<PaymentFail />} />*/}
                {/*<Route path="/payment/result" element={<PaymentResult />} />*/}
                {/*<Route path="/theater" element={<Theater />} />*/}
                <Route path="*" element={<div>찾으시는 창이 없네요</div>} />
            </Routes>
            {/*<Category />*/}
            <Footer />
        </BrowserRouter>
    );
};

export default Router;
